//: Advent of Code 2018: 05 - Alchemical Reduction (Part 1)
// https://adventofcode.com/2018/day/5

import XCTest

extension Character {
  var isUppercase: Bool {
    if let unicodeScalar = unicodeScalars.first {
      return CharacterSet.uppercaseLetters.contains(unicodeScalar)
    } else {
      return false
    }
  }
  
  var isLowercase: Bool {
    if let unicodeScalar = unicodeScalars.first {
      return CharacterSet.lowercaseLetters.contains(unicodeScalar)
    } else {
      return false
    }
  }
  
  func isSame(letter: Character) -> Bool {
    return String(self).lowercased() == String(letter).lowercased()
  }
}

func calculate(input: String) -> Int {
  
  var outputs = [String: String]()
  
  for letter in input {
    let key = String(letter).lowercased()
    if outputs[key] == nil {
      let filteredInput = input.filter { (unit) -> Bool in
        !unit.isSame(letter: letter)
      }
      let output = reduce(input: filteredInput)
      outputs[key] = output
    }
  }
  
//  print("outputs: \(outputs)")
  
  var shortest: String? = nil
  for (key, output) in outputs {
    if let unwrappedShortest = shortest {
      if output.count < unwrappedShortest.count {
        shortest = output
      }
    } else {
      shortest = output
    }
  }
  
  return shortest?.count ?? 0
}

func reduce(input: String) -> String {
  let output = Array(input).reduce("") { (result, unit) -> String in
    var append = true
    
    if let lastChar = result.last, lastChar.isSame(letter: unit) && ((lastChar.isUppercase && unit.isLowercase) || (lastChar.isLowercase && unit.isUppercase)) {
      append = false
    }
    
    let value: String
    if append {
      value = result + String(unit)
    } else {
      value = String(result[..<result.index(before: result.endIndex)])
    }
    
    return value
  }
  
  return output
}

class SequenceTests: XCTestCase {
  func testInput1() {
    let value = calculate(input: "dabAcCaCBAcCcaDA")
    XCTAssertEqual(value, 4)
  }

}

SequenceTests.defaultTestSuite.run()

let input = ""

let value = calculate(input: input)
print(value)
// Correct Answer: 5898
